import React, {Component} from 'react';
import ReactDom from 'react-dom';
import "./Painting.css";
import Gallerynav from './gallerynav';
import pic1 from '../img/pic1.jpg';
import pic2 from '../img/pic2.jpg';
import pic3 from '../img/pic3.jpg';
import pic4 from '../img/pic4.jpg';
import pic5 from '../img/pic5.jpg';
import pic6 from '../img/pic6.jpg';
import pic7 from '../img/pic7.jpg';
import pic8 from '../img/pic8.jpg';




const onepaint = <img src={pic1} width='200' height='200'/>;
const twopaint = <img src={pic2} width='200' height='200'/>;
const threepaint = <img src={pic3} width='200' height='200'/>;
const fourpaint = <img src={pic4} width='200' height='200'/>;
const Painting = () =>{
    
    

    
    return (
        <div>
            <Gallerynav />
            {/*<button type="button" class="btn" onclick = {()=>{}}>⚙</button>*/}
        <div class="grid-container">
        <div class="grid-item">
             <img src={pic1} width='200' height='200'/>
        </div>
        <div class="grid-item"><img src={pic2} width='200' height='200'/></div>
        <div class="grid-item"><img src={pic3} width='200' height='200'/></div>
        <div class="grid-item"><img src={pic4} width='200' height='200'/></div>
        <div class="grid-item"><img src={pic5} width='200' height='200'/></div>
        <div class="grid-item"><img src={pic6} width='200' height='200'/></div>
        <div class="grid-item"><img src={pic7} width='200' height='200'/></div>
        <div class="grid-item"><img src={pic8} width='200' height='200'/></div>
        </div>
        </div>

        
        
        
    );
    
}

export {onepaint,twopaint,threepaint,fourpaint};

export default Painting;
